import {NativeModules} from 'react-native';
export default  {
    async printContent(data){
      try {
        if(data.type == 'receipt') {await this._printReceipt(data)}
        else if(data.type == 'history') {await this._printOrderHistory(data)}
      } catch (e) {

      }

    },
    async _printReceipt(data)
    {

      let logo = "data:image/bmp;base64,"
      //ensure the base64 string without URI Scheme
       let logobase64 = logo.replace("data:image/bmp;base64,","");
       console.log(data);
         try {
             await NativeModules.customAndroid.lineWrap(1);



             await NativeModules.customAndroid.printOriginalText("       ");

             await NativeModules.customAndroid.printBitmap(logobase64, 200/*width*/, 150/*height*/);

             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText(data.dltypeMessage + "  #" + data.orderNumber);


             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText(data.restaurantName);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText(data.restaurantAddress);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText(data.restaurantPhoneNumber);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("Time: " + data.orderTime);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("Order Number: #" + data.orderNumber);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("________________________________");
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printLine("No.","Dish","Price",6,12,12,0,1,2);
             for(let i = 0; i < data.orderArray.length; i++){
                // await NativeModules.customAndroid.printOriginalText(data.orderArray[i].ds_id);
                // await NativeModules.customAndroid.printOriginalText("    "+data.orderArray[i].ds_name);
                // await NativeModules.customAndroid.printOriginalText("    "+data.orderArray[i].amount);
                // await NativeModules.customAndroid.printOriginalText("    "+data.orderArray[i].price);
                await NativeModules.customAndroid.printLine(data.orderArray[i].ds_id,data.orderArray[i].ds_name,data.orderArray[i].amount+' x '+data.orderArray[i].price,6,12,12,0,1,2);
             }
             if( data.comment) {
               await NativeModules.customAndroid.printOriginalText("_______________________________");
               await NativeModules.customAndroid.lineWrap(2);
               await NativeModules.customAndroid.printOriginalText("Comment: " + data.comment );
               await NativeModules.customAndroid.lineWrap(2);
             }


             await NativeModules.customAndroid.printOriginalText("_______________________________");
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText("Subtotal: $"+data.subTotal);
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText("Tax: $"+data.tax);
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText("Total: $"+data.total);
             await NativeModules.customAndroid.lineWrap(2);
             await NativeModules.customAndroid.printOriginalText("_______________________________");
             await NativeModules.customAndroid.lineWrap(2);
             await NativeModules.customAndroid.printOriginalText("Customer Service: chanmaoweixin");
             await NativeModules.customAndroid.lineWrap(6);

         }catch(e){
             console.log(e)
             alert("print error."+e.message);
         }
    },
    async _printOrderHistory(data)
    {

      let logo = "data:image/bmp;base64,"
       //ensure the base64 string without URI Scheme
       let logobase64 = logo.replace("data:image/bmp;base64,","");

         try {

           console.log(data);
             await NativeModules.customAndroid.lineWrap(1);
             await NativeModules.customAndroid.printOriginalText("       ");
             await NativeModules.customAndroid.printBitmap(logobase64, 200/*width*/, 150/*height*/);

             console.log('1111111111');
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText(data.restaurantName);

             console.log('2222222222');

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText(data.restaurantAddress);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText(data.restaurantPhoneNumber);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("Time: " + data.timeTerm);

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("Order Amount: " + data.orderAmount);
             await NativeModules.customAndroid.printOriginalText("($" + data.total + ")");

             await NativeModules.customAndroid.lineWrap(1);

             await NativeModules.customAndroid.printOriginalText("________________________________");
             await NativeModules.customAndroid.lineWrap(2);
             await NativeModules.customAndroid.printOriginalText("No.     Date             Total");
             await NativeModules.customAndroid.lineWrap(2);
             for(let i = 0; i < data.orderArray.length; i++){
                await NativeModules.customAndroid.printOriginalText(data.orderArray[i].oid);
                await NativeModules.customAndroid.printOriginalText("    "+data.orderArray[i].date);
                await NativeModules.customAndroid.printOriginalText("    $"+data.orderArray[i].total);

                await NativeModules.customAndroid.lineWrap(2);
             }
             await NativeModules.customAndroid.printOriginalText("________________________________");
             await NativeModules.customAndroid.lineWrap(2);

             await NativeModules.customAndroid.printOriginalText("Customer Service: xiaomingpeisong_ca");
             await NativeModules.customAndroid.lineWrap(6);



         }catch(e){
             console.log(e)
             alert("print error."+e.message);
         }
    },




}
